import {getProject, types as t} from "@theatre/core"
import state from "./state.json"
//import studio from "@theatre/studio"
// studio.initialize()

const proj = getProject("foobarloremipsum", {state})
const sheet = proj.sheet("Bouncing box")

const nudgableNumber = t.number(1, {nudgeMultiplier: 0.01})

function makeBouncingBox(i: number) {
  const component = document.getElementById("component")
  //const boxContainer = document.getElementById("boxContainer")
  const boxDiv = document.getElementById("box")
  const dustDiv = document.getElementById("dust")
  const textDiv = document.getElementById("text")

  component?.addEventListener("click", () => {
    sheet.sequence.play({iterationCount: 3});
    component.style.backgroundColor = "#ff00f7"
  })

  const boxObj = sheet.object("Box", {
    y: 0,
    stretch: nudgableNumber,
  })
  boxObj.onValuesChange(({y, stretch}) => {
    if (boxDiv!=null)
     boxDiv.style.transform = `translateY(${-y}px) scale(${
        1 / stretch
      }, ${stretch})`
  })

  const dustObj = sheet.object("Dust", {
    opacity: nudgableNumber,
    scaleX: nudgableNumber,
  })
  dustObj.onValuesChange(({opacity, scaleX}) => {
    if (dustDiv!=null){
      dustDiv.style.opacity = String(opacity)
      dustDiv.style.transform = `scaleX(${scaleX})`
    }
  })

  const textObj = sheet.object("Text", { position: {x: 10, y: 10} } )
  textObj.onValuesChange((values) => {
    if (textDiv!=null){
      textDiv.style.left=values.position.x+'px'
      textDiv.style.top=values.position.y+'px'
    }
  })

  const textObj1 = sheet.object("Text1", {content: "foo" })
  // const e1=textObj1.onValuesChange((values) => {
  //   if (textDiv!=null){
  //     textDiv.innerText=values.content
  //   }
  // })

  const textObj2 = sheet.object("Text2", {content: "baz"})
  // const e2=textObj2.onValuesChange((values) => {
  //   if (textDiv!=null){
  //     textDiv.innerText=values.content
  //   }
  // })

  const textObj3 = sheet.object("Text3", {content: "bar"})
  // const e3=textObj3.onValuesChange((values) => {
  //   if (textDiv!=null){
  //     textDiv.innerText=values.content
  //     console.log(values.content)
  //   }
  // })
  if (textDiv!=null)
      textDiv.innerText=textObj1.value.content

  component?.addEventListener("mouseout", () => {
    if (textDiv!=null)
      textDiv.innerText=textObj1.value.content
  })
  component?.addEventListener("click", () => {
    if (textDiv!=null)
    textDiv.innerText=textObj2.value.content
  })

  component?.addEventListener("mouseover", () => {
    if (textDiv!=null)
      textDiv.innerText=textObj3.value.content
  })


  // textObj.onValuesChange(({mouseover, click}) => {
  //   textDiv.label = t.string('foo'),
  //   textDiv.labelmouseover = t.string('bar'),
  //   textDiv.labelclick = t.string('baz')
  // });
}

makeBouncingBox(1)
